import React from 'react'

const Skills = () => {
    const skill = ['JavaScript','React','Node.js','ML','Django']
  return (
    <div>
        <ul>
            {skill.map((s,index)=>
            (
                <li key={index}>{s}</li>
            ))}
        </ul>
    </div>
  )
}

export default Skills
